//     document.body.appendChild(script); 
// }


// shouldComponentUpdate() { return false; };


  return (
    <Container fluid>
     <div style={{width: 300, margin: 0, padding: 0, border: 0}}><iframe title="badge" src="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300" frameBorder={0} border={0} cellSpacing={0} style={{width: 300, height: 300, margin: 0, padding: 0, overflow: 'hidden', border: 0}} /><div style={{fontSize: 'x-small', fontFamily: 'Arial, Tahoma, sans-serif', textAlign: 'right', width: 300, margin: 0, padding: 0}}><a style={{textDecoration: 'none', color: '#999999'}} href="http://www.budgetyourtrip.com?r=widget" target="_blank">Budget Your Trip</a></div></div>

    </Container>
   );

}
export default Result;
